// src/Options.js
import React from 'react';

function Options({ onSelectOption }) {
    const options = ["Option 1", "Option 2", "Option 3"];

    return (
        <div>
            <h3>Options</h3>
            <ul>
                {options.map((option, index) => (
                    <li key={index} onClick={() => onSelectOption(option)}>
                        {option}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default Options;
